import React, { useState } from 'react';
import { X, ExternalLink, Info } from 'lucide-react';

const SettingsPanel = ({ apiToken, setApiToken, onClose }) => {
  const [localToken, setLocalToken] = useState(apiToken);
  const [showSuccess, setShowSuccess] = useState(false);

  const handleSave = () => {
    setApiToken(localToken);
    setShowSuccess(true);
    setTimeout(() => setShowSuccess(false), 3000);
  };

  const handleClose = () => {
    setLocalToken(apiToken); // Reset to original value
    onClose();
  };

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg shadow-xl max-w-md w-full mx-4 max-h-[90vh] overflow-y-auto">
        {/* Header */}
        <div className="flex items-center justify-between p-6 border-b">
          <h2 className="text-xl font-semibold text-gray-800">Settings</h2>
          <button
            onClick={handleClose}
            className="p-2 text-gray-400 hover:text-gray-600 hover:bg-gray-100 rounded-lg transition-colors"
          >
            <X size={20} />
          </button>
        </div>

        {/* Content */}
        <div className="p-6 space-y-6">
          {/* API Token Section */}
          <div>
            <h3 className="text-lg font-medium text-gray-800 mb-3">
              🔑 Hugging Face API Configuration
            </h3>
            <p className="text-gray-600 mb-4">
              Configure your free API token to enable AI-powered responses.
            </p>
            
            <div className="space-y-3">
              <label className="block text-sm font-medium text-gray-700">
                API Token
              </label>
              <input
                type="password"
                value={localToken}
                onChange={(e) => setLocalToken(e.target.value)}
                placeholder="hf_xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx"
                className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-primary focus:border-transparent"
              />
            </div>
          </div>

          {/* Instructions */}
          <div className="bg-blue-50 border border-blue-200 rounded-lg p-4">
            <h4 className="font-medium text-blue-800 mb-3 flex items-center gap-2">
              <Info size={16} />
              How to Get Your Free API Token:
            </h4>
            <ol className="list-decimal list-inside text-blue-700 text-sm space-y-1">
              <li>Go to <a href="https://huggingface.co/settings/tokens" target="_blank" rel="noopener noreferrer" className="underline hover:text-blue-800 flex items-center gap-1 inline-flex">
                Hugging Face <ExternalLink size={12} />
              </a></li>
              <li>Sign up for a free account</li>
              <li>Navigate to Settings → Access Tokens</li>
              <li>Create a new token with <strong>"Read"</strong> permissions</li>
              <li>Copy and paste it above</li>
            </ol>
          </div>

          {/* Free Tier Benefits */}
          <div className="bg-green-50 border border-green-200 rounded-lg p-4">
            <h4 className="font-medium text-green-800 mb-2">🆓 Free Tier Benefits:</h4>
            <ul className="text-green-700 text-sm space-y-1">
              <li>• 30,000 requests per month</li>
              <li>• No credit card required</li>
              <li>• Access to state-of-the-art models</li>
            </ul>
          </div>

          {/* Success Message */}
          {showSuccess && (
            <div className="bg-green-50 border border-green-200 rounded-lg p-4 text-green-700 text-center">
              ✅ API token updated successfully!
            </div>
          )}
        </div>

        {/* Footer */}
        <div className="flex justify-end gap-3 p-6 border-t">
          <button
            onClick={handleClose}
            className="px-4 py-2 text-gray-600 hover:text-gray-800 hover:bg-gray-100 rounded-lg transition-colors"
          >
            Cancel
          </button>
          <button
            onClick={handleSave}
            className="px-4 py-2 bg-primary hover:bg-primary/90 text-white rounded-lg transition-colors"
          >
            Save Changes
          </button>
        </div>
      </div>
    </div>
  );
};

export default SettingsPanel;
